        <div class="flex flex-col">
            <div class="flex flex-col px-32 py-24 gap-y-8 text-blue_700_gray_100">
                <div class="flex flex-col gap-y-4">
                    <div id="woordgebruik" class="border border-0 border-b border-blue_700_gray_100 inline-flex">
                        <h4 class="text-header_m">Gebruik van <span class="gradient-text">woorden</span></h4>
                    </div>
                    <div class="grid grid-flow-row grid-rows-1 grid-cols-2 gap-8">
                        <div>
                            <p>
                                We gebruiken het liefst makkelijke taal, zo is het voor iedereen te volgen. Je zult de volgende woorden hieronder vaker terug zien komen, dus voor het gemak leggen we hier even uit wat ze in deze algemene voorwaarden betekenen.
                            </p>
                        </div>
                        <div>
                            <p>
                                – de ‘aanbieder’ of ‘wij/we’/ons, daarmee bedoelen we onszelf (MH E-learnings V.O.F.)<br><br>
                                – de ‘producten’, dit zijn de producten die we aanbieden. Daaronder valt alles wat je op deze website kunt vinden, alles op dit me-learning platform en natuurlijk alles in de me-learnings zelf.<br><br>
                                – ‘je’ of ‘deelnemer’, dat ben jij! Althans, dat wordt je zodra je een me-learning bij ons gaat doen. Dat is ook het moment waarop deze algemene voorwaarden gaan gelden.
                            </p>
                        </div>
                    </div>
                </div>
                <div class="flex flex-col gap-y-4">
                    <div id="resultaten" class="border border-0 border-b border-blue_700_gray_100 inline-flex">
                        <h4 class="text-header_m">Verantwoording en <span class="gradient-text">resultaten</span></h4>
                    </div>
                    <div class="grid grid-flow-row grid-rows-1 grid-cols-2 gap-8">
                        <div>
                            <p>
                                Omdat je bij ons soms met uitdagende onderwerpen aan de slag gaat, hebben we er bij het ontwikkelen van onze producten alles aan gedaan om eventuele negatieve gevolgen te voorkomen. Hiermee doelen we op gevolgen die ontstaan doordat er een fout in onze me-learnings zit, of wanneer je tips uit een me-learning gebruikt voor een onderwerp waarvoor ze niet gemaakt zijn. Beiden proberen we te voorkomen door onze producten met oog voor detail samen te stellen, en duidelijk te vertellen waarover een me-learning gaat.<br><br>

                                Ook kunnen we geen verantwoording nemen wanneer je de vragen in onze programma’s niet eerlijk beantwoord, en daardoor dus advies krijgt wat niet bij je past. We spreken daarom af dat antwoorden die je geeft waar zijn, of zo dicht mogelijk bij de realiteit liggen. Op die manier hebben onze me-learnings het meeste effect.
                            </p>
                        </div>
                        <div>
                            <p>
                                Je neemt volledige verantwoording voor alles wat je tot nu toe hebt meegemaakt, én voor alle gevolgen daarvan. Wij beloven dat we alles doen en gedaan hebben om jou de tools te geven waarmee je maximaal resultaat kunt halen. Uiteraard blijft dit wel binnen het acceptabele, we geven je niet onze pincode om maar een voorbeeld te noemen ;). Je erkent dat als er dingen gebeuren die confronterend en/of heftig zijn, dat dit voorkomt uit jouw proces van het aangaan van oudere onopgeloste zaken, en niet door ons (onze me-learnings kunnen dingen die al langer speelden namelijk blootleggen).<br><br>

                                Je erkent juist dat onze producten zijn gemaakt om deze zaken aan te gaan, en wij dus niet verantwoordelijk zijn voor eventuele gevolgen van het aangaan van (hardnekkige) oude gewoontes en manieren van denken. We spreken af dat je de aanwijzingen uit onze producten zo goed mogelijk opvolgt, en dat je bij pijn, last of controleverlies gelijk stopt met de oefening(en) en direct zowel een arts of specialist, als een vriend of familielid inschakelt en op de hoogte stelt.
                            </p>
                        </div>
                    </div>
                </div>
            </div>
            <div class="flex flex-col px-32 py-24 gap-y-8 bg-blue_700_blue_900 rounded-xl text-gray-100">
                <div class="flex flex-col gap-y-4">
                    <div id="andere-bedrijven" class="border border-0 border-b border-gray_100 inline-flex">
                        <h4 class="text-header_m"><span class="gradient-text">Andere</span> bedrijven</h4>
                    </div>
                    <div class="grid grid-flow-row grid-rows-1 grid-cols-2 gap-8">
                        <div>
                            <p>
                                We beloven dat we jouw privé-informatie (en alles wat daarbij hoort) nooit zullen delen met andere partijen, tenzij dat vanwege wetgeving of rechtelijk bevel noodzakelijk is. We handelen niet in wat voor gegevens dan ook, en delen deze niet met externe bedrijven.<br><br>

                                Wat we wel doen, is data anoniem opslaan. Dat doen we om daar bijvoorbeeld statistieken uit te kunnen halen. Denk aan ‘de afgelopen 4 jaar hebben … mensen de me-learning over stress gedaan, en …% van hen gaf aan dat ze na drie weken aanzienlijk minder stress voelden.’
                            </p>
                        </div>
                        <div>
                            <p>
                                Als we hier positieve cijfers uit kunnen halen, kan dat betekenen dat onze me-learnings in de toekomst vergoedt worden door de zorgverzekeraar. Die wil natuurlijk wel weten wat de resultaten van een me-learning zijn voordat ze ‘m vergoeden. Maar, zoals gezegd, als we met deze statistieken aan de slag gaan, zal jouw naam nooit naar boven komen. Die data is volledig anoniem.<br><br>

                                Ook zul je af en toe een link naar een extern commercieel product tegenkomen. Denk hierbij aan bijvoorbeeld een boek. Dit doen we omdat dat boek in dat geval een aanvulling (geen vervanging) kan zijn op de informatie uit onze me-learnings. Deze producten zijn altijd optioneel. Mocht je kiezen het product aan te schaffen via de link die we je geven, levert dit ons een klein bedrag op. Daarmee kunnen we de kosten van ons platform laag houden.
                            </p>
                        </div>
